use Switch;

sub myStatsSum {
	@input = @_;
	@output = ('99999999999','-999999999','0','0','0');  # min, max, mean, stdev, n

	foreach $data(@input){
		if($data <= $output[0]){$output[0] = $data}
		if($data >= $output[1]){$output[1] = $data}
		$output[2] += $data;
		$output[4] ++;
	}

	$output[2] = $output[2] / $output[4];
	
	foreach $data(@input){
		$output[3] += (($data-$output[2])**2);
	}
	
	$output[3] = $output[3] / $output[4];
	$output[3] = $output[3]**0.5;
	
	return(@output);
}


